import React, { useState } from "react";

// Each "ItemType" element in the array have a array of children ID's. These refer
// to a ItemType.
// = This has a infinite depth.
/*
const items: ItemType[] = [
  { id: 1, title: "Item 1", children: [1, 2, 3] },
  { id: 2, title: "Item 2", children: [12, 3, 4] },
  { id: 3, title: "Item 3", children: [1, 2, 4] },
  { id: 4, title: "Item 3", children: [1, 2, 3] }
];
*/

function Heading({title} : {title:String})  {

  const sampleJSON = {
    "arrOfNumbers": [1, 2, 3, 4],
    "arrOfStrings": ["a", "b", "c", "d"],
    "arrOfObjects": [{ "a": 1, "b": 1 }, { "a": 2, "b": 2 }, { "a": 3, "b": 3 }]
  }

  return (

    <div>

      <h2>Array of Numbers:</h2>
      <ul>
        {sampleJSON.arrOfNumbers.map((item, i) => {
          return <li key={i}>{item}</li>
        })}
      </ul>

      <h2>Array of Strings:</h2>
      <ul>
        {sampleJSON.arrOfStrings.map((item, i) => {
          return <li key={i}>{item}</li>
        })}
      </ul>

      <h2>Array of Objects:</h2>
      <ul>
        {sampleJSON.arrOfObjects.map((item, i) => {
          const newToDoList = [...sampleJSON.arrOfObjects, {"id": 3}]
          return <li key={i}>{item.a} - {item.b}</li>
        })}
      </ul>

    </div>

  );
}

function App() {
  return (
    <div>
     <Heading title="Commenting" />
    </div>
  );
}


export default App;
